// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract MockCollection is Ownable{
    using Strings for uint;
    address private addr1;
    address private addr2;
    string private baseURI;
    uint private counter;
    mapping(uint => address) private owners;
    constructor() Ownable(){
        counter = 0;
    }
    function setAddr1(address _addr1) public {
        addr1 = _addr1;
    }
    function setAddr2(address _addr2) public {
        addr2 = _addr2;
    }
    function ownerOf(uint256 tokenId) external view returns (address owner){
        require(_exists(tokenId), "ERC721: owner query for nonexistent token"); //mock 
        if(tokenId == 1)
            return addr1;
        if(tokenId == 2)
            return addr2;
        return owners[tokenId];
    }
    function setBaseURI(string memory _newBaseURI) public onlyOwner { baseURI = _newBaseURI; }
    function _baseURI() public view returns(string memory){return baseURI;}
    function _exists(uint _id) internal view returns (bool){
        return owners[_id] != address(0);
    }
    function tokenURI(uint _tokenId) public view virtual returns (string memory) {
        require(_exists(_tokenId), "URI query for nonexistent token");
        string memory uri = _baseURI();
        return bytes(uri).length > 0 ? string(abi.encodePacked(baseURI, _tokenId.toString())) : "";
    }
    function mint() public {
        counter = (counter + 1) % 1000000;
        owners[counter] = msg.sender;
    }
}

